import React from "react";
import { Link } from "react-router-dom";
import logo from "../logo.svg";

function Header() {
  return (
    <header>
      <Link to="/">
        <img src={logo} alt="Logo" className="logo" />
      </Link>
      <div className="header-right">
        <Link to="/products" className="header-link">
          Products
        </Link>
        <Link to="/pricing" className="header-link">
          Pricing
        </Link>
        <Link to="/sign-in" className="header-link">
          Sign In
        </Link>
      </div>
    </header>
  );
}

// Add CSS styles for the header
const styles = {
  header: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "0 30px",
    backgroundColor: "#232F3E",
    color: "#FFFFFF",
  },
  logo: {
    width: "130px",
  },
  "header-right": {
    display: "flex",
    alignItems: "center",
  },
  "header-link": {
    marginLeft: "30px",
    color: "#FFFFFF",
    textDecoration: "none",
    fontWeight: "bold",
  },
};

export default Header;
